import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./QuizDashboard.css";

const QuizDashboard = () => {
  const navigation = useNavigate();
  const [quizQns, setQuizQns] = useState([]);
  const [createQuiz, setCreateQuiz] = useState(false);
  const handleLogout = () => {
    navigation("/");
  };

  const handleCreateQuiz = () => {
    console.log("Hello");
    setCreateQuiz(pre => !pre);
  };
  console.log(createQuiz);
  return (
    <div className="dashboard-container">
      <div className="header">
        <div className="user-greeting">Hello, Kishan</div>
        <button className="logout-btn" onClick={handleLogout}>
          Logout
        </button>
      </div>
      <div className="content">
        <h2>Welcome to the Quiz Dashboard</h2>
        {/* Add your quiz content here */}
        <button className="create-quiz-btn" onClick={handleCreateQuiz}>
          Create Quiz
        </button>
        {createQuiz ? (
          // Add your quiz creation form here
          <form>
            <input type="text" placeholder="Enter quiz title" />
            <input type="text" placeholder="Enter quiz description" />
            <input type="number" placeholder="Enter number of questions" />
            {/* Add your question input fields here */}
            <button type="submit">Create Quiz</button>
          </form>
        ) : (
          // Add your quiz list here
          <ul>
            {quizQns.map((quiz) => (
              <li key={quiz._id}>{quiz.title}</li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default QuizDashboard;
